import React from "react";
import ReactDOM from "react-dom";
import "../index.css"

const crnDate = new Date().toLocaleDateString();
const crnTime = new Date().toLocaleTimeString();

ReactDOM.render(
  <>
  <h1>SK Technical</h1>
  <p>This CrnDate {crnDate} </p>
  <p>This CrnTime {crnTime} </p>
  </>,

  document.getElementById("root")

);
